import React from 'react';
import {
  Nav,
  NavLink,
  Bars,
  NavMenu,
} from './Navbar/NavbarElements';
  
const Navbar = () => {
  return (
    <>
      <Nav>
        <Bars />
  
        <NavMenu>
            <NavLink to='/index' activeStyle>
            Home
            </NavLink>
            <NavLink to='/products' activeStyle>
            Products
            </NavLink>
            <NavLink to='/about' activeStyle>
            About Us
            </NavLink>
          {/* Second Nav */}
          {/* <NavBtnLink to='/sign-in'>Sign In</NavBtnLink> */}
        </NavMenu>
      </Nav>
    </>
  );
};
  
export default Navbar;
